INSERT INTO `hcseo_search` (`id`, `cfrom`, `cfrom_id`, `cid`, `name`, `content`, `postdate`, `editdate`) VALUES
(146, 'Title', 1, 188, 'Wall', '<p class=\\"lg22\\" style=\\"margin-top: 80px\\">\r\n	The Vo Living team are experts who specialize in granite, tile, hardwoods, and cabinets. Utilizing our large selection of materials, we give customers a new renovating experience and aim to provide them with a one stop shop where everything they may need for their renovation projects can be found. Having over 15 years of experience, we have the high quality craftsmanship and the latest technology required to fabricate materials that match our designer&rsquo;s or client&rsquo;s needs. From the kitchen to the bathroom, Vo Living will provide you with everything and help make your vision a reality.</p>\r\n', 1421199563, 1421199638),
(147, 'Title', 3, 188, 'Bathroom', '<p class=\\"lg22\\" style=\\"margin-top: 80px\\">\r\n	The Vo Living team are experts who specialize in granite, tile, hardwoods, and cabinets. Utilizing our large selection of materials, we give customers a new renovating experience and aim to provide them with a one stop shop where everything they may need for their renovation projects can be found. Having over 15 years of experience, we have the high quality craftsmanship and the latest technology required to fabricate materials that match our designer&rsquo;s or client&rsquo;s needs. From the kitchen to the bathroom, Vo Living will provide you with everything and help make your vision a reality.</p>\r\n', 1421199624, 0),
(148, 'Title', 2, 188, 'Flooring', '<p class=\\"lg22\\" style=\\"margin-top: 80px\\">\r\n	The Vo Living team are experts who specialize in granite, tile, hardwoods, and cabinets. Utilizing our large selection of materials, we give customers a new renovating experience and aim to provide them with a one stop shop where everything they may need for their renovation projects can be found. Having over 15 years of experience, we have the high quality craftsmanship and the latest technology required to fabricate materials that match our designer&rsquo;s or client&rsquo;s needs. From the kitchen to the bathroom, Vo Living will provide you with everything and help make your vision a reality.</p>\r\n', 1421199634, 0),
(149, 'Gallery', 9, 190, 'Test3', '', 1421202277, 1421202326),
(150, 'Gallery', 10, 190, 'Test2', '', 1421202320, 0),
(152, 'News', 3, 201, '皇室迷梦', '<p>\r\n	<strong><span style="color: rgb(71, 71, 70); font-family: ''Microsoft YaHei''; line-height: 20px; background-color: rgb(240, 232, 206);">Sophia kah品牌主营高级女装，品牌由Ana Teixeira de Sousa创立于2010年。Sophia kah的动人创意设计精心，旨在构建一个外观完整的整体风格，打造别致的现代女人形象，可以肯定的是，精致的风格将使</span></strong></p>\r\n', 1438585800, 1438650772),
(153, 'News', 4, 201, '皇室迷梦', '<pre style="color: rgb(0, 0, 0); font-family: 宋体; font-size: 12pt;">\r\n<span style="background-color:#efefef;"><!--</span--><span style="color:#000080;background-color:#efefef;font-weight:bold;">volist</span><span style="background-color:#efefef;">&gt;</span></span></pre>\r\n', 1438585964, 1438650753);
INSERT INTO `hcseo_settings` (`id`, `ischecked`, `postdate`, `editdate`, `attachsize`, `attachext`, `iswater`, `maskimg`, `filesize`, `lang`, `indexTitle`, `indexKeyword`, `indexDiscription`, `image`, `contactus`, `logo`, `title`, `facebook`, `twitter`, `copyright`, `top_location`, `index_text`, `about`, `about_images`, `contact`, `Carrer`, `map`, `gallery`, `top`) VALUES
(5, 0, '', '', '', 'jpg,gif,png', '否', NULL, '', 'en', 'KERRYA', 'KERRYA', 'KERRYA', '__ROOT__/Attachments/b/20140310/531d57440c068.png', '<br />\r\n<h3 style=\\"color:#343434; font-weight:bold; margin-bottom:10px;\\">\r\n	Hours of Operation</h3>\r\n<p>\r\n	Mon - Fri 7:30-12:00 / 1:00-4:30</p>\r\n<p>\r\n	Sat 8:00-12:00</p>\r\n<p>\r\n	Sun Closed</p>\r\n<br />\r\n<br />\r\n<h3 style=\\"color:#343434; font-weight:bold; margin-bottom:10px;\\">\r\n	Contact Us</h3>\r\n<p>\r\n	403.208.8808</p>\r\n<p>\r\n	403.291.8808</p>\r\n<p>\r\n	info@kingswoodinteriors.ca</p>\r\n', '__ROOT__/Attachments/b/20150803/1438572818CD5JLw7Q4i.png', 'KERRYA', 'kerrya@facebook.com', 'kerrya@twitter.com', '© 2015 KERRYA Ltd. All Rights are reserved.', 'LOCATION: 2821 16 Ave SE Calgary, AB T2A 0M7 | TEL: 403.272.8836', '<table style="width: 500px;">\r\n	<tbody>\r\n		<tr>\r\n			<td>\r\n				<p>\r\n					&nbsp;</p>\r\n				<p>\r\n					&nbsp;</p>\r\n				<p>\r\n					<span style="font-family: monospace; white-space: pre-wrap;">作为一家以服装为主的集团企业，《凯莉娅集团》始终坚持自己的使命：以最为精致的服饰，最为合理的价格提供给相信凯莉娅的人士们，以创新式开发理念，一站式的优质服务，打造国际第一高端品牌。</span></p>\r\n			</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n<p>\r\n	&nbsp;</p>\r\n', '<p>\r\n	<span style="color: rgb(0, 0, 0); font-family: monospace; font-size: medium; white-space: pre-wrap;">法国凯莉娅集团 (FRENCH KARLIA GROUP)自创建以来，集团始终站在世界潮流的前沿，以&ldquo;打造世界名牌&rdquo;为目标，为大都市的时尚潮人打造极致优雅形象，并荣获中央电视台授权为其形象服装高级定制。集团一直坚持&ldquo;诚信、卓越、创新、奉献&rdquo;的经营理念，现已发展成为以产品研发为核心导向，集生产、营销、管理、务服为一体的多元化现代企业。在发展中始终坚持稳中求进，精益求精的发展思路，专注市场的需求，关注生产品的研发，强化人力的培养和管理。我们坚信在集团所有合作伙伴及全体的同仁不懈努力下，法国凯莉娅集团 (FRENCH KARLIA GROUP)一定会成为深受社会尊敬，同行敬仰的企业。</span></p>\r\n', '7', '<p>\r\n	&nbsp;</p>\r\n<table cellspacing="3" class="info" style="width: 800px;">\r\n	<tbody>\r\n		<tr>\r\n			<td class="fw dan-green" style="width: 148px;">\r\n				President :&nbsp;</td>\r\n			<td>\r\n				Andy Vo &nbsp; &nbsp; &nbsp; andy.vo@voliving.ca</td>\r\n			<td>\r\n				&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;</td>\r\n			<td>\r\n				&nbsp;</td>\r\n			<td>\r\n				&nbsp;</td>\r\n		</tr>\r\n		<tr>\r\n			<td class="fw dan-green">\r\n				General Manager:</td>\r\n			<td>\r\n				Eddy Yu &nbsp; &nbsp; &nbsp; eddy.yu@voliving.ca</td>\r\n			<td>\r\n				&nbsp;</td>\r\n			<td>\r\n				&nbsp;</td>\r\n			<td>\r\n				&nbsp;</td>\r\n		</tr>\r\n		<tr>\r\n			<td class="fw dan-green">\r\n				Order Desk:</td>\r\n			<td>\r\n				<pre style="color: rgb(0, 0, 0); font-family: 宋体; font-size: 12pt;">\r\n0000000@163.com</pre>\r\n			</td>\r\n			<td>\r\n				&nbsp;</td>\r\n			<td>\r\n				&nbsp;</td>\r\n			<td>\r\n				&nbsp;</td>\r\n		</tr>\r\n		<tr>\r\n			<td class="fw dan-green">\r\n				&nbsp;</td>\r\n			<td>\r\n				&nbsp;</td>\r\n			<td>\r\n				&nbsp;</td>\r\n			<td>\r\n				&nbsp;</td>\r\n			<td>\r\n				&nbsp;</td>\r\n		</tr>\r\n		<tr>\r\n			<td class="fw dan-green">\r\n				Phone Number:</td>\r\n			<td>\r\n				<span style="color: rgb(0, 0, 0); font-family: 宋体; font-size: 12pt;">公司总机：</span><span style="color: rgb(0, 0, 0); font-family: 宋体; font-size: 12pt;">020-81000000/22</span></td>\r\n			<td>\r\n				&nbsp;</td>\r\n			<td>\r\n				&nbsp;</td>\r\n			<td>\r\n				&nbsp;</td>\r\n		</tr>\r\n		<tr>\r\n			<td class="fw dan-green">\r\n				Fax &nbsp; &nbsp; Number:</td>\r\n			<td>\r\n				<span style="color: rgb(0, 0, 0); font-family: 宋体; font-size: 12pt;">服务热线：</span><span style="color: rgb(0, 0, 0); font-family: 宋体; font-size: 12pt;">4008-000-888</span></td>\r\n			<td>\r\n				&nbsp;</td>\r\n			<td>\r\n				&nbsp;</td>\r\n			<td>\r\n				&nbsp;</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n<p>\r\n	&nbsp;</p>\r\n', '<p>\r\n	&nbsp; &nbsp; &nbsp; &nbsp; It is our belief that in order to make our clients happy, we must first give a safe and uplifting environment for our staff. When our staff spends each day with a smile, they are able to pass on that smile to each of our clients and provide them with a shopping experience that makes their project enjoyable and fun. When it comes to customer service, Vo Living sticks with the tried and true method of keeping the customer&rsquo;s needs first. If you show any interest in becoming a part of the Vo Living team and wish to help us in providing the best service and highest quality craftsmanship to our customers and their projects, send us an email or upload your resume to the contact info provided.</p>\r\n<p>\r\n	&nbsp;</p>\r\n<p>\r\n	<strong><em>We are currently looking for these positions to expand our team:</em></strong></p>\r\n<ul>\r\n	<li>\r\n		Designers of all types,</li>\r\n	<li>\r\n		Sales attendant/Managers</li>\r\n	<li>\r\n		Project Managers</li>\r\n	<li>\r\n		Installation</li>\r\n	<li>\r\n		Fabricator</li>\r\n	<li>\r\n		Assistants</li>\r\n	<li>\r\n		Administration</li>\r\n</ul>\r\n', '__ROOT__/Public/en/images/map.png', NULL, '');
